    key: "computeTotalPrice",
    value: function computeTotalPrice() {
      var review = document.querySelector('.js-review-order');
      var quantity = document.querySelectorAll('input[name="orderCount"]');
      var hiddenPrice = document.querySelectorAll('input[name="price"]');
      var price = document.querySelectorAll('.js-price');
      var totalPerItem = 0.00;
      var total = 0.00;
      var totalElement = document.querySelector('.js-total');

      if (review != null) {
        quantity.forEach(function (qty, index) {
          if (!qty.value) {
            price[index].innerHTML = "0.00";
          } else {
            totalPerItem = parseFloat(qty.value) * parseFloat(hiddenPrice[index].value.replace(/,/g, ''));
            price[index].innerHTML = totalPerItem.toLocaleString("en", {
              minimumFractionDigits: 2
            });
            total = total + totalPerItem;
          }
        });
        totalElement.innerHTML = total.toLocaleString("en", {
          minimumFractionDigits: 2
        });
      }
    }
