    value: function addClassNameListener(selector, callback) {
      var elem = document.querySelectorAll(selector);
      elem.forEach(function (inElem) {
        var lastClassName = inElem.className;
        window.setInterval(function () {
          var className = inElem.className;

          if (className !== lastClassName) {
            callback({
              elem: inElem,
              "class": className
            });
            lastClassName = className;
          }
        }, 10);
      });
    }
